import Pagination from "react-bootstrap/Pagination";
import Props from "./IProps";

const PaginationComponent: React.FC<Props> = ({
  pagination,
  handleChangePage,
}) => {
  const paginationItem = [
    {
      id: "1",
      number: 1,
    },
    {
      id: "2",
      number: 2,
    },
    {
      id: "3",
      number: 3,
    },
  ];
  return (
    <Pagination>
      <Pagination.Prev onClick={() => handleChangePage("prev")} />
      {paginationItem.map((item) => (
        <Pagination.Item active={pagination.page === item.number}>
          {item.number}
        </Pagination.Item>
      ))}
      <Pagination.Item active={pagination.page === 1}>{1}</Pagination.Item>
      {/* <Pagination.Ellipsis /> */}

      <Pagination.Next onClick={() => handleChangePage("next")} />
    </Pagination>
  );
};

export default PaginationComponent;
